import React from 'react';

const TodoList = (props) => {
    return(
        <div> 
            <ul className="collection with-header">
                <li className="collection-header"><h5>Todos</h5></li>
                {props.todos.map((item) => (
                    <a href="#!" className="collection-item" key={item._id}>{item.name} {item.todoItem} {item.date}
                     <button className="btn btn-small waves-effect waves-light black" type="submit" name="action">+</button>

                    </a>
                ))}
            </ul>
        </div>
    )
}

export default TodoList;
